import axios from 'axios'
import React, { useEffect, useState } from 'react'

export default function Posts(props) {

    const [data, setdata] = useState([])

    useEffect(() => {
        axios.get(`https://jsonplaceholder.typicode.com/${props.component}`)
            .then((res) => {
                console.log(res.data);
                setdata(res.data)
            })
    }, [])

    return (
        <div className='text-center bg-secondary mt-5'>
            <h1>{props.component}</h1>
            <section className='row justify-content-around'>
        {
          data.map((ele, ind) => {
            return (
              <div className='card bg-warning col-5 mb-5' key={ind}>
                <h1>{ele.name}</h1>
                <h1>{ele.username}</h1>
                <button onClick={() => Navigate(`/Profile/${ele.id}`)} >View Profile</button>
              </div>
            )
          })
        }

      </section>
        </div>
    )
}
